  Link
} from "react-router-dom";


function App() {
  return (
    <div className="App">
      <Router>
        <Link className="headNavigation" to="/">Home</Link>
        <Link className="headNavigation"to="/favorite">Favorites</Link>
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/myCart" exact component={Favorites} />
        </Switch>
      <AutocompleteSearchContext>
